// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/Address.sol";

contract Executor is Ownable, Pausable, ReentrancyGuard {
    using SafeERC20 for IERC20;
    using Address for address;

    error ExecutionFailed(uint256 index, address target, bytes reason);
    error InvalidInjectionOffset(uint256 offset, uint256 length);
    error ZeroAmountInjection();

    struct TokenPull {
        address token;
        uint256 amount;
    }

    struct Approval {
        address token;
        address spender;
        uint256 amount;
        bool revokeAfter;
    }

    struct Call {
        address target;
        uint256 value;
        bytes data;
        address injectToken; // If non-zero, injects the balance of this token into the call data
        uint256 injectOffset; // The byte offset in 'data' to overwrite with the balance
    }

    constructor(address initialOwner) Ownable(initialOwner) {}

    receive() external payable {}

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function rescueFunds(address token, address to, uint256 amount) external onlyOwner {
        IERC20(token).safeTransfer(to, amount);
    }

    function rescueETH(address payable to, uint256 amount) external onlyOwner {
        Address.sendValue(to, amount);
    }

    function execute(
        TokenPull[] calldata pulls,
        Approval[] calldata approvals,
        Call[] calldata calls,
        address[] calldata tokensToFlush
    ) external payable nonReentrant whenNotPaused returns (bytes[] memory results) {
        uint256 ethBalanceBefore = address(this).balance - msg.value;
        uint256[] memory tokenBalancesBefore = _snapshotBalances(tokensToFlush);

        _pullTokens(pulls);
        _setApprovals(approvals);
        results = _performCalls(calls);
        _revokeApprovals(approvals);
        _flushDeltas(msg.sender, tokensToFlush, tokenBalancesBefore, ethBalanceBefore);
    }

    function _snapshotBalances(address[] calldata tokens) private view returns (uint256[] memory balances) {
        balances = new uint256[](tokens.length);
        for (uint256 i; i < tokens.length;) {
            balances[i] = IERC20(tokens[i]).balanceOf(address(this));
            unchecked { ++i; }
        }
    }

    function _pullTokens(TokenPull[] calldata pulls) private {
        for (uint256 i; i < pulls.length;) {
            TokenPull calldata p = pulls[i];
            IERC20(p.token).safeTransferFrom(msg.sender, address(this), p.amount);
            unchecked { ++i; }
        }
    }

    function _setApprovals(Approval[] calldata approvals) private {
        for (uint256 i; i < approvals.length;) {
            Approval calldata a = approvals[i];
            IERC20(a.token).forceApprove(a.spender, a.amount);
            unchecked { ++i; }
        }
    }

    function _performCalls(Call[] calldata calls) private returns (bytes[] memory results) {
        results = new bytes[](calls.length);
        for (uint256 i; i < calls.length;) {
            Call calldata c = calls[i];

            bytes memory data = c.data;

            if (c.injectToken != address(0)) {
                uint256 injectedAmount = IERC20(c.injectToken).balanceOf(address(this));
                if (injectedAmount == 0) revert ZeroAmountInjection();

                if (c.injectOffset + 32 > data.length) revert InvalidInjectionOffset(c.injectOffset, data.length);

                uint256 offset = c.injectOffset;
                assembly {
                    mstore(add(add(data, 32), offset), injectedAmount)
                }
            }

            (bool success, bytes memory ret) = c.target.call{value: c.value}(data);

            if (!success) {
                if (ret.length > 0) {
                    assembly {
                        let returndata_size := mload(ret)
                        revert(add(32, ret), returndata_size)
                    }
                } else {
                    revert ExecutionFailed(i, c.target, "");
                }
            }
            results[i] = ret;
            unchecked { ++i; }
        }
    }

    function _revokeApprovals(Approval[] calldata approvals) private {
        for (uint256 i; i < approvals.length;) {
            Approval calldata a = approvals[i];
            if (a.revokeAfter) {
                IERC20(a.token).forceApprove(a.spender, 0);
            }
            unchecked { ++i; }
        }
    }

    function _flushDeltas(
        address recipient,
        address[] calldata tokens,
        uint256[] memory balancesBefore,
        uint256 ethBalanceBefore
    ) private {
        for (uint256 i; i < tokens.length;) {
            uint256 balanceAfter = IERC20(tokens[i]).balanceOf(address(this));
            if (balanceAfter > balancesBefore[i]) {
                IERC20(tokens[i]).safeTransfer(recipient, balanceAfter - balancesBefore[i]);
            }
            unchecked { ++i; }
        }

        uint256 ethBalanceAfter = address(this).balance;
        if (ethBalanceAfter > ethBalanceBefore) {
            Address.sendValue(payable(recipient), ethBalanceAfter - ethBalanceBefore);
        }
    }
}

contracts/Lens.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

import "./lib/Interfaces.sol";

contract Lens {
    struct V2PoolData {
        address pool;
        uint112 reserve0;
        uint112 reserve1;
        address token0;
        address token1;
        bool exists;
    }

    struct V3PoolData {
        address pool;
        uint160 sqrtPriceX96;
        int24 tick;
        uint128 liquidity;
        address token0;
        address token1;
        uint24 fee;
        bool exists;
    }

    struct TokenMetadata {
        address token;
        uint8 decimals;
        string symbol;
        string name;
        bool exists;
    }

    function batchGetV2PoolData(address[] calldata pools) external view returns (V2PoolData[] memory results) {
        results = new V2PoolData[](pools.length);
        for (uint256 i = 0; i < pools.length; i++) {
            results[i].pool = pools[i];

            if (pools[i].code.length == 0) {
                results[i].exists = false;
                continue;
            }

            try this.getV2PoolDataSingle(pools[i]) returns (V2PoolData memory data) {
                results[i] = data;
            } catch {
                results[i].exists = false;
            }
        }
    }

    function batchGetV3PoolData(address[] calldata pools) external view returns (V3PoolData[] memory results) {
        results = new V3PoolData[](pools.length);
        for (uint256 i = 0; i < pools.length; i++) {
            results[i].pool = pools[i];

            if (pools[i].code.length == 0) {
                results[i].exists = false;
                continue;
            }

            try this.getV3PoolDataSingle(pools[i]) returns (V3PoolData memory data) {
                results[i] = data;
            } catch {
                results[i].exists = false;
            }
        }
    }

    function batchGetTokenMetadata(address[] calldata tokens) external view returns (TokenMetadata[] memory results) {
        results = new TokenMetadata[](tokens.length);
        for (uint256 i = 0; i < tokens.length; i++) {
            results[i].token = tokens[i];

            if (tokens[i].code.length == 0) {
                results[i].exists = false;
                continue;
            }

            try this.getTokenMetadataSingle(tokens[i]) returns (TokenMetadata memory data) {
                results[i] = data;
            } catch {
                results[i].exists = false;
            }
        }
    }

    /**
     * @notice Batch check token balances for a single account
     * @param tokens Array of token addresses
     * @param account The account to check balances for
     * @return Array of balances
     */
    function batchCheckTokenBalances(
        address[] calldata tokens,
        address account
    ) external view returns (uint256[] memory) {
        uint256[] memory balances = new uint256[](tokens.length);

        for (uint256 i = 0; i < tokens.length; i++) {
            if (tokens[i].code.length == 0) {
                balances[i] = 0;
                continue;
            }

            try IERC20(tokens[i]).balanceOf(account) returns (uint256 balance) {
                balances[i] = balance;
            } catch {
                balances[i] = 0;
            }
        }

        return balances;
    }

    /**
     * @notice Batch check token allowances
     * @param tokens Array of token addresses
     * @param owner Token owner
     * @param spender Approved spender
     * @return Array of allowances
     */
    function batchCheckAllowances(
        address[] calldata tokens,
        address owner,
        address spender
    ) external view returns (uint256[] memory) {
        uint256[] memory allowances = new uint256[](tokens.length);

        for (uint256 i = 0; i < tokens.length; i++) {
            if (tokens[i].code.length == 0) {
                allowances[i] = 0;
                continue;
            }

            try IERC20(tokens[i]).allowance(owner, spender) returns (uint256 allowance) {
                allowances[i] = allowance;
            } catch {
                allowances[i] = 0;
            }
        }

        return allowances;
    }

    function getV2PoolDataSingle(address pool) external view returns (V2PoolData memory data) {
        data.pool = pool;
        (uint112 r0, uint112 r1, ) = IUniswapV2Pair(pool).getReserves();
        data.reserve0 = r0;
        data.reserve1 = r1;
        data.token0 = IUniswapV2Pair(pool).token0();
        data.token1 = IUniswapV2Pair(pool).token1();
        data.exists = true;
    }

    function getV3PoolDataSingle(address pool) external view returns (V3PoolData memory data) {
        data.pool = pool;
        (
            uint160 sqrtPriceX96,
            int24 tick,
            ,,,, 
        ) = IUniswapV3Pool(pool).slot0();

        data.sqrtPriceX96 = sqrtPriceX96;
        data.tick = tick;
        data.liquidity = IUniswapV3Pool(pool).liquidity();
        data.token0 = IUniswapV3Pool(pool).token0();
        data.token1 = IUniswapV3Pool(pool).token1();
        data.fee = IUniswapV3Pool(pool).fee();
        data.exists = true;
    }

    function getTokenMetadataSingle(address token) external view returns (TokenMetadata memory data) {
        data.token = token;
        data.decimals = IERC20Metadata(token).decimals();
        data.symbol = IERC20Metadata(token).symbol();
        data.name = IERC20Metadata(token).name();
        data.exists = true;
    }
}

contracts/lib/Interfaces.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;

interface IUniswapV2Pair {
    function getReserves() external view returns (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast);
    function token0() external view returns (address);
    function token1() external view returns (address);
}

interface IUniswapV3Pool {
    function slot0() external view returns (
        uint160 sqrtPriceX96,
        int24 tick,
        uint16 observationIndex,
        uint16 observationCardinality,
        uint16 observationCardinalityNext,
        uint8 feeProtocol,
        bool unlocked
    );
    function liquidity() external view returns (uint128);
    function token0() external view returns (address);
    function token1() external view returns (address);
    function fee() external view returns (uint24);
}

interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
    function allowance(address owner, address spender) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
    function approve(address spender, uint256 amount) external returns (bool);
}

interface IERC20Metadata {
    function decimals() external view returns (uint8);
    function symbol() external view returns (string memory);
    function name() external view returns (string memory);
}

